import React from "react";

export default function InfoTooltip({ state, onClose }) {
  console.log(state)
  const resOk = ''

  return (
    <section

      className={`popup popup_infotooltip ${
        state !== "" ? "popup_opened" : ""
      }`}
      onClick={onClose}
    >
      <div className="popup__container popup__container_infotooltip">
        {/* <img
          className="popup__img_infotooltip"
          src='../../images/ok.svg'
          alt={111}
          onClick={(e) => e.stopPropagation()}
        /> */}
        {state === "ok" ? <div className="popup__img_infotooltip_ok"/> 
        : <div className="popup__img_infotooltip_error"/>}
        <figcaption className="popup__caption_infotooltip">
          {state === "ok"
            ? "Вы успешно зарегистрировались"
            : "Что-то пошло не так! Попробуйте еще раз"}
        </figcaption>
        <button
          type="button"
          className="popup__close"
          onClick={onClose}
        />
      </div>
    </section>
  );
}
